import React, { useState, useEffect } from "react";
import axios from "axios";
import "./App.css";

import PokemonAbilities from "./Components/PokemonAbilites";
import HomePage from "./Components/HomePage";
import { Box, Card, Typography, CardContent } from "@mui/material";

function App() {
  const [name, setName] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get("http://localhost:5001/pokemon/");
      setName(response.data.data);
    };
    fetchData();
  }, []);
  return (
    <div className="App">
      <Box
        sx={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fill, minmax(200px, 1fr))",
          gap: "16px",
          width: "100%",
          maxWidth: "1200px",
        }}
      >
        {name?.map((i, index) => (
          <div key={index}>
            <Card
              sx={{
                display: "grid",
                gridTemplateColumns: "repeat(auto-fill, minmax(200px, 1fr))",
                gap: "16px",
                width: "100%",
              }}
            >
              <CardContent>
                <Typography variant="h6" component="div">
                  <PokemonAbilities pokemonName={i.name} />
                  <HomePage />
                </Typography>
              </CardContent>
            </Card>
          </div>
        ))}
      </Box>
    </div>
  );
}
export default App;
